import React from 'react';
import ReactDOM from 'react-dom'
import './index.css';
let name = 'Nishi';
const img1 = "https://picsum.photos/40";
const img2 = "https://picsum.photos/90";
const img3 = "https://picsum.photos/200";
const links = "https://google.com";
ReactDOM.render(
    <>
    <h1 className = "Heading"> My name is {name} </h1>
    <img src = {img1} alt = "A Random Image"/>
    <br/>
    <div className= "img_div">
        <a href={links} target = "_blank">
            <img src = {img2} alt = "A Random Image"/>
        </a>
        <img src = {img3} alt = "A Random Image"/>
    </div>
    </>,
    document.getElementById('root')
);

